import logo from './logo.svg';
import './App.css';
import { Route, Routes } from 'react-router-dom';
import Homepage from './components/homepage/home';
import Menu from './components/menu/menu';


function App() {
  return (
    <div>
        <Menu/>
          <Routes>
            <Route path='/home'>
              <Homepage/>
            </Route>
          </Routes>
    </div>
  );
}

export default App;
